# 1 "src/Lexer.fsl"
 

module Lexer
open Parser
open Microsoft.FSharp.Text.Lexing
exception LexErr of string
let lexeme = LexBuffer<_>.LexemeString

// Reserved words.
let reserved =
      [ ("fun",   FUN)
      ; ("match", MATCH)
      ; ("with",  WITH)
      ; ("type",  TYPE)
      ; ("of",    OF)
      ; ("let",   LET)
      ; ("rec",   REC)
      ; ("unit",  UNIT)
      ; ("inf",   INF)
      ; ("not",   NOT)] |> Map.ofList

// Symbols.
let symbols =
      [ ("?",  HOLE)
      ; ("|>", REFINES)
      ; ("|*|", COMPLEXITY)
      ; ("=",  EQUAL)
      ; ("->", ARROW)
      ; (",",  COMMA)
      ; (":",  COLON)
      ; (";",  SEMI)
      ; ("*",  STAR)
      ; ("|",  PIPE)
      ; ("(",  LPAREN)
      ; (")",  RPAREN)
      ; ("[",  LBRACKET)
      ; ("]",  RBRACKET)
      ; ("/\\", AND)
      ; ("\\/", OR)] |> Map.ofList

// Create a token.
let create_token lexbuf =
    let str = lexeme lexbuf
    if reserved.ContainsKey(str) then reserved.[str] else LID str

// Create a symbol.
let create_symbol lexbuf =
    let str = lexeme lexbuf
    if symbols.ContainsKey(str) then symbols.[str]
    else raise (LexErr (sprintf "Unexpected token: %s" str))

// Create a projection.
let create_proj lexbuf =
    let str = lexeme lexbuf in
    PROJ (System.Int32.Parse str.[1..])


